import React from "react";
import ReactDOM from "react-dom";
import Card from "./Card";
import Sdata from "./Sdata";
import "./index.css";

ReactDOM.render(
  <>
    <h1 className="heading_style">Top 5 Netflix shows</h1>

    <Card
      imgsrc={Sdata[0].imgsrc}
      link={Sdata[0].tit}
      sname={Sdata[0].sname}
      title={Sdata[0].sname}
    />

    <Card
      imgsrc={Sdata[1].sname}
      link={Sdata[1].sname}
      sname={Sdata[1].sname}
      title={Sdata[1].sname}
    />

    <Card
      imgsrc={Sdata[2].sname}
      link={Sdata[2].sname}
      sname={Sdata[2].sname}
      title={Sdata[2].sname}
    />

    <Card
      imgsrc={Sdata[3].sname}
      link={Sdata[3].sname}
      sname={Sdata[3].sname}
      title={Sdata[3].sname}
    />

    <Card
      imgsrc={Sdata[4].sname}
      link={Sdata[4].sname}
      sname={Sdata[4].sname}
      title={Sdata[4].sname}
    />
  </>,
  document.getElementById("root")
);
